import { Table, Button } from 'reactstrap';
import React from 'react';




export default function TableShopping(props) {
    return (
      <Table responsive>
        <thead>
          <tr>
            <th>Num</th>
            <th>Nombre Tour</th>
            <th>Descripcion</th>
            <th>Cantidad</th>
            <th>Precio Unitario</th>
            <th>Precio Usuario</th>
            <th>Eliminar</th>
          </tr>
        </thead>
        <tbody>
          {
            props.carrito.map(row => ( 
              <tr>
                <td> {row.Num} </td>

              </tr>
            ))
          }
        </tbody>
      </Table>
    );
  }
